import styles from "./CartItem.module.css";
function CartItem(props) {
	return (
		<>
			<h3>{props.item}</h3>
			<span>{props.price}</span>
			<span>x{props.amount}</span>
			<button>-</button>
			<button>+</button>
			<div>
				<h3>Total Amount</h3>
				<h3>{props.total}</h3>
			</div>
		</>
	);
}
export default CartItem;
